	this.shape.graphics.f().s("#000000").ss(1,1,1).p("AOKAAQAAF3kKEJQkJEKl3AAQl2AAkKkKQkJkJAAl3QAAl2EJkKQEKkJF2AAQF3AAEJEJQEKEKAAF2g");
