	this.timeline.addTween(cjs.Tween.get({}).to({state:[{t:this.shape},{t:this.play_btn}]}).to({state:[]},1).wait(1));

	// walking
	this.blueHead_mc = new lib.walking();
	this.blueHead_mc.name = "blueHead_mc";
	this.blueHead_mc.setTransform(822.1,615.55,1,1,0,0,0,-20,-49.1);
